import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';


const pricingTable = [
  {
    "key": "standard-package",
    "header": "Standard",
    "title":"Great place to start small projects.",
    "amountTitle":"AS LOW AS",
    "amount":"$28 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "bodyTitle":"Features include:",
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "gold-package",
    "header": "Gold",
    "title":"Dedicated support and more features.",
    "amountTitle":"AS LOW AS",
    "amount":"$40 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "bodyTitle":"Everything in Standard plus:",
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "platinum-package",
    "header": "Platinum",
    "title":"Advanced functionality with 24/7 support.",
    "amountTitle":"AS LOW AS",
    "amount":"$50 /month",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "bodyTitle":"Everything in Gold plus::",
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },
      {
        "li": "And more"
      }
    ]
  },
  {
    "key": "enterprise-package",
    "header": "Enterprise",
    "title":"The fully loaded package with endpoint protection by default.",
    "amountTitle":"",
    "amount":"Contact us to find out more",
    "backgroundColor":"linear-gradient(to top right, #1A329E, #95A6EE)",
    "buttonTitle": "Choose Plan",
    "bodyTitle":"Everything in Platinum plus:",
    "bodyContent": [
      {
        "li": "Core Elastic Stack security features",
      },
      {
        "li": "Capabilities such as Elastic APM, App Search, Workplace Search, Security, and Maps",
      },
      {
        "li": "Canvas & Lens",
      },

    ]
  },

]


const planNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase',
  marginBottom:'50px',
}

const titleStyles={
  display:'flex',
  justifyContent:'center',
  textAlign:'center',
  color:'white',
  fontSize:'14px',
  fontWeight:'350',
  paddingLeft:'10px',
  paddingRight:'10px',
  height:"35px",
  marginBottom:'30px'
  // marginTop:'5px',
}

const amountTitleStyles={
  display:'flex',
  justifyContent:'center',
  textAlign:'center',
  color:'#ccc',
  fontSize:'14px',
  fontWeight:'500',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingRight:'20px',
  paddingLeft:'20px',
  textAlign:'center',
  // marginTop:'25px',
  // marginBottom:'20px'
}

const bodyTitleStyles={
  display:'flex',
  justifyContent:'center',
  textAlign:'center',
  color:'#ccc',
  fontSize:'14px',
  fontWeight:'500',
}


const listStyles={
  fontSize:"15px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',
  paddingRight:'20px'
}

const buttonStyles={
  fontSize:'20px',
  marginBottom:'30px',
  borderRadius:'25px',
  backgroundColor:'white',
  paddingRight:'60px',
  paddingLeft:'60px',
  paddingTop:'5px',
  paddingBottom:'5px',
  color:'#008F69'
}

const buttonPosition={
  // display:'flex',
  marginLeft:'50px',
  marginTop:"100px",
  justifyContent:'flex-end',
  alignItems:'baseline'
};


function App() {
  return (
    <div>
     <PriceCardDisplayV
     pricingTable={pricingTable}
     planNameStylesStyles={planNameStyles}
     titleStyles={titleStyles}
     amountTitleStyles={amountTitleStyles}
     amountStyles={amountStyles}
     bodyTitleStyle={bodyTitleStyle}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     buttonPosition={buttonPosition}
     />
    </div>
  );
}

export default App;
